            sidenews: [],
        };
    }

  componentDidMount(){

  }

  renderItems() {
    return this.state.sidenews.map((item) => (
      <SingleSide key={item.url} item={item} />
    ));
  }

  render() {
    return (
     <div className="row">
       {this.renderItems()}
